import styled from "styled-components/macro";

const Wrapper = styled.div`
  .explore-container {
      height: 600px;
      background-color: #000;
      padding: 0 24px;

  }

  .explore-title {
    margin:0;
    padding: 50px 0 80px 0;
    color: #fff;
    font-size: 48px;
    font-family: 'Montserrat';
    font-style: normal;
  }

  .explore-content {
    width: 100%;
    padding: 20px;
  }

  .explore-item {
    width: 50%;
    float: left;
    padding: 20px;
  }

`;

export default Wrapper;
